import React from "react"

export default function Skills() {
    return(
        <div>
            <p className="text-2xl text-white m-5 justify-center">
            Some of my skills include strong communication, analytical skills, research and problem solving. Other newly developed skills include Javascript, React, ReactHooks, React props, mongoose, Html, express, MongoDB, MySQL, reset api etc ... and responsive web design. My interest include developing data-basses, back-end development, and building meaningful user friendly websites with React!
            </p>
        </div>
    )
}
